import React, { Component } from 'react';
import './flexbox.css';
import lineup from './img/lineup.jpg';

class LineUp extends Component {
    // constructor() {
    //     super()

    // }
    render() {
        return (
            <div >
                <img className="img" src={lineup} alt="shit"></img>
            </div>
        );
    }
}

export default LineUp;
